import React from 'react';
import { Button } from '@mantine/core';
import styled from 'styled-components';

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const Home = () => {
  return (
    <Wrapper>
      <p>What's the best tech stack for your application?</p>
      <p>
        Answer some questions so that we can personalize our recommendations to
        suit your application's needs
      </p>
      <Button color="cyan" radius="md" size="md" uppercase>
        Start
      </Button>
    </Wrapper>
  );
};

export default Home;
